"154084":{"id":"154084","name":"Citadel Honey Bunny","slug":"citadel-honey-bunny","original_title":"Citadel Honey Bunny","overview":"Quando o dublê Bunny recruta a atriz em dificuldades Honey para um bico, eles são lançados em um mundo de ação, espionagem e traição de alto risco. Anos depois, quando seu passado perigoso os alcança, Honey e Bunny, que estavam separados, precisam se reunir e lutar para proteger sua jovem filha Nadia.","first_air_date":"2024-11-06","episode_run_time":0,"vote_average":7,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Sita Menon"],"production_companies":["AGBO","Midnight Radio","D2R Films","Amazon MGM Studios","Super Epic"],"genres":["Action & Adventure","Drama","Sci-Fi & Fantasy"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/c1zX0L9X2UXeOemCg8FSDReMO6G.jpg","poster_path":"https://image.tmdb.org/t/p/original/lzZ9J2FOsaq1DCuD7k2f4ogbXdD.jpg","cast":["Samantha Ruth Prabhu","Varun Dhawan","Kay Kay Menon","Kashvi Majmundar","Simran"],"trailer":"c7mhtsLL84U","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/lzZ9J2FOsaq1DCuD7k2f4ogbXdD.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/lzZ9J2FOsaq1DCuD7k2f4ogbXdD.jpg","air_date":"2024-11-06","episode_count":6,"overview":"N/A","vote_average":6.8,"episodes":{"1":{"name":"Dançando e Lutando","overview":"1992: Bunny, um dublê de filmes, recruta a atriz Honey para um trabalho paralelo que põe a vida dela em risco. 2000: A vida idílica da mãe solteira Honey e de sua filha Nadia é destruída quando o passado de Honey volta à tona. O distante Bunny descobre uma verdade avassaladora!","air_date":"2024-11-06","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/2EEB1MQcldphUBHbU2pLLskg3kA.jpg","vote_average":7},"2":{"name":"Talwar","overview":"1992: A agência de Guru rouba o Project Talwar de seu inimigo. Enquanto o romance floresce entre Honey e Bunny, ela se infiltra ainda mais na agência, apesar do ceticismo de Guru. 2000: Bunny se reúne com Chacko para procurar Honey e Nadia, que estão fugindo de seus agressores.","air_date":"2024-11-06","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/iMzbY86smsItCv1rXOdbyVxeZgA.jpg","vote_average":6},"3":{"name":"Jogo de Espiões","overview":"1992: Bunny e Honey embarcam na missão mais importante da agência em Belgrado. Honey faz uma descoberta chocante. 2000: Bunny quase encontra Honey e Nadia. Temendo o pior e sem outra escolha, ele e Chacko pedem ajuda ao antigo amigo Ludo.","air_date":"2024-11-06","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/pTs0xuvuzRyTsUxekmaJceCQmRO.jpg","vote_average":6.5},"4":{"name":"Casa","overview":"1992: Honey luta para equilibrar seus sentimentos pessoais e seu amor por Bunny com seu dever em relação à missão, lidando com um profundo conflito interno. 2000: Honey se depara com um dilema semelhante ao ter que decidir se busca refúgio na casa de sua infância, um lugar odiado por ela. Enquanto isso, Bunny faz uma descoberta importante sobre Guru e suas verdadeiras motivações!","air_date":"2024-11-06","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/78hlB5TY4qeNNbjoGL2FrODqEC6.jpg","vote_average":7},"5":{"name":"Traidor","overview":"1992: O mundo de Honey vira de cabeça para baixo quando ela descobre que a agência em que sempre confiou não é o que parece, forçando-a a tomar uma medida drástica que coloca a vida de todos em risco. 2000: Bunny planeja o próximo passo de Honey, tão drástico quanto o que ela tomou no passado.","air_date":"2024-11-06","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/xYcfwll9ivtOXZyhc9nehHRHPiW.jpg","vote_average":7},"6":{"name":"Jogue","overview":"2000: Quando as coisas chegam ao ápice, Honey e Bunny se unem para irem com força total, lutando por amor, família e pelo futuro de sua filha. Enquanto KD decide resolver as coisas por conta própria, a batalha seguinte testa sua resiliência, deixando o futuro incerto.","air_date":"2024-11-06","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/rmWQEA0xOp9Rd6shDHMeueTkXn5.jpg","vote_average":7}}}}},
